import React from "react";
import {
  FaEnvelope,
  FaPhone,
  FaMapMarkerAlt,
  FaFacebook,
  FaInstagram,
  FaLinkedin,
  FaTwitter,
  FaWhatsapp,
} from "react-icons/fa";

const Footer = () => {
  return (
    <>
      <style>{`
        .footer-container {
          background: url("/backgrounds/footer-bg.png") no-repeat center center;
          background-size: cover;
          padding: 40px 20px;
          font-family: 'Arial', sans-serif;
          color: #000;
        }

        .associated-title {
          text-align: center;
          font-size: 2rem;
          font-weight: bold;
          color: #0b1033;
          margin-bottom: 20px;
        }

        .associates-logos {
          display: flex;
          justify-content: space-around;
          align-items: center;
          flex-wrap: wrap;
          padding: 20px;
          background-color: #e6e8f0;
          margin-bottom: 40px;
        }

        .associates-logos img {
          height: 40px;
          margin: 10px 20px;
          object-fit: contain;
        }

        .footer-grid {
          display: flex;
          flex-wrap: wrap;
          justify-content: space-between;
          gap: 40px;
        }

        .footer-logo img {
          height: 60px;
        }

        .footer-section {
          min-width: 250px;
        }

        .footer-section h3 {
          font-size: 18px;
          margin-bottom: 16px;
        }

        .footer-section ul {
          list-style: none;
          padding: 0;
          margin: 0;
        }

        .footer-section li {
          margin-bottom: 10px;
          display: flex;
          align-items: flex-start;
          gap: 8px;
          line-height: 1.5;
        }

        .footer-socials {
          display: flex;
          gap: 20px;
          margin-top: 30px;
        }

        .footer-socials svg {
          font-size: 24px;
          color: #333;
          cursor: pointer;
          transition: color 0.3s ease;
        }

        .footer-socials .fa-facebook:hover { color: #1877f2; }
        .footer-socials .fa-instagram:hover { color: #e1306c; }
        .footer-socials .fa-linkedin:hover { color: #0077b5; }
        .footer-socials .fa-twitter:hover { color: #1da1f2; }
        .footer-socials .fa-whatsapp { color: #25d366; font-size: 28px; }
      `}</style>

      <div className="footer-container">
        <div className="associated-title">Associated With</div>

        <div className="associates-logos">
          <img src="/logos/boostmysites.png" alt="Boost My Sites" />
          <img src="/logos/technext.png" alt="Technext Solutions" />
          <img src="/logos/venteskraft.png" alt="Venteskraft" />
          <img src="/logos/quantumsoft.png" alt="Quantumsoft" />
        </div>

        <div className="footer-grid">
          <div className="footer-logo">
            <img src="/logos/aiwebx.png" alt="AI WebX Logo" />
          </div>

          <div className="footer-section">
            <h3>Our Services</h3>
            <ul>
              <li>Web Development</li>
              <li>App Development</li>
              <li>AI & ML Development</li>
              <li>Blockchain Solutions</li>
              <li>Cloud Computing Services</li>
              <li>VR & AR Development</li>
            </ul>
          </div>

          <div className="footer-section">
            <h3>Contact Info</h3>
            <ul>
              <li><FaEnvelope /> <strong>Email:</strong> info@aiwebx.in</li>
              <li><FaPhone /> <strong>Phone:</strong> +91 63013 50318</li>
              <li><FaMapMarkerAlt /> <strong>Location:</strong> 10-47 Ambedkar Nagar, Jawaharnagar, Turmalagiri, Hyderabad - 500087, Telangana, India</li>
            </ul>
            <div className="footer-socials">
              <FaFacebook className="fa-facebook" />
              <FaInstagram className="fa-instagram" />
              <FaLinkedin className="fa-linkedin" />
              <FaTwitter className="fa-twitter" />
              <FaWhatsapp className="fa-whatsapp" />
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Footer;
